import React from 'react'
import './mint.css';
import {Base,BaseWithChain} from '../imgs/nfts/nfts';
import {useNavigate} from 'react-router-dom';
export default function Mint() {
  let navigate = useNavigate();
  return (
    <><div class="mint-container">
          <img id="mint-pic" src={BaseWithChain} />
          <div class="text-wrapper">
              <h1>Mint you're Phoenix!</h1>
              <p>Unlock premium benefits, and earn lots of money!</p>
              <a class="btn" id="coming-soon">Coming Soon!</a>
          </div>
      </div><a class="btn" id="connect-wallet">Connect Wallet</a><a class="btn" href="index.html" id="back">Back</a></>
  )
}
